import React,{useRef, useState} from 'react';

export function Chart(setSymbols:any){
    let cnv:any = useRef(null);
    let ctx = cnv.current.getContext('2d');
    ctx.beginPath();
    ctx.rect(40,40,200,200);
    ctx.fillStyle = 'blue';
    ctx.fill();
    return (
        <canvas ref={cnv} style={{width:'60%',height:'80%'}}>
        </canvas>
    );   
}
